INSERT INTO `products` VALUES (1,'Laptop Asus TUF Gaming',1200,'1711078092373-asus-01.png','READY FOR ANYTHING - Jump right into the action with Windows 11, an Intel Core i7-13620HCPU, and NVIDIA GeForce RTX 4060 Laptop GPU at 140W Max TGP.\nSWIFT MEMORY AND STORAGE – Multitask faster with 16GB of DDR5-4800MHz memory and speed up loading times with 1TB of PCIe 4x4.\nNEVER MISS A MOMENT – Keep up with the pros thanks to its fast FHD 144Hz display with 100% sRGB color. Adaptive sync tech reduces lag, minimizes stuttering, and eliminates visual tearing for ultra-smooth and lifelike gameplay.',' Intel, Core i5, 11400H',99,NULL,'ASUS','GAMING'),(2,'Laptop Dell Inspiron 15',3000,'1711078452562-dell-01.png','Experience responsive yet quiet performance, featuring up to 12th generation Intel® Core™ processors combined with PCIe SSD options.\nBenefit from roomy keycaps and a spacious touchpad that makes it easier to navigate your content and ComfortView software, which is a TUV Rheinland certified solution, reduces harmful blue light emissions to keep your eyes comfortable over extended viewing times. Also, sleek three-side narrow borders encase a FHD display.','i5 1235U/16GB/512GB/15.6\"FHD',199,NULL,'DELL','OFFICE'),(3,'Lenovo IdeaPad Gaming 3',1000,'1711079073759-lenovo-01.png','The IdeaPad 3 is priced as an everyday-use laptop—but engineered as something much more. Premium Intel® processing—as well as powerful memory and storage options—means this PC delivers beyond expectations. Bonus: The numeric keypad will speed up your productivity, whether you’re working on your personal budget or preparing a spreadsheet',' i5-10300H, RAM 8G',150,NULL,'LENOVO','GAMING'),(4,'Asus K501UX',1500,'1711079496409-asus-02.png','14 inches 1920 x 1080 (Full HD) Anti-glare Three-Sided NanoEdge Design.','VGA NVIDIA GTX 950M- 4G',99,NULL,'ASUS','GRAPHIC'),(5,'MacBook Air 13',1000,'1711079954090-apple-01.png','Remarkably light and less than half an inch thin, MacBook Air fits easily into your on-the-go lifestyle — and your bag. MacBook Air with M4 is made with over 50 percent recycled materials and has a durable recycled aluminum enclosure.','Apple M1 GPU 7 cores',99,NULL,'APPLE','GAMING'),(6,'Laptop LG Gram Style',2000,'1711080386941-lg-01.png','LG gram delivers powerhouse AI performance in an ultra-thin, ultra-light design. Weighing just 3.2 lbs., the sleek 17” anti-glare touch display is built for productivity anywhere. With an Intel¹ Evo Edition Core Ultra 7 processor, for AI intensive workloads, the laptop provides performance, boosts efficiency, and fuel AI productivity.','Intel Iris Plus Graphics',99,NULL,'LG','OFFICE'),(7,'MacBook Air 13',1100,'1711080787179-apple-02.png','','Apple M2 GPU 8 cores',99,NULL,'APPLE','COMPACT'),(8,'Laptop Acer Nitro',1300,'1711080948771-acer-01.png','Remarkably light and less than half an inch thin, MacBook Air fits easily into your on-the-go lifestyle — and your bag. MacBook Air with M4 is made with over 50 percent recycled materials and has a durable recycled aluminum enclosure.','AN515-58-769J i7 12700H',99,NULL,'ACER','OFFICE'),(9,'Laptop Acer Nitro V',1200,'1711081080930-asus-03.png','The Acer Nitro V 15 ANV15-51 notebook is engineered for those who demand power and performance, whether for gaming, content creation, or multitasking. At the heart of this notebook lies a 10-core Intel Core i7 processor and NVIDIA GeForce RTX graphics, ensuring smooth and responsive performance across all your applications.\nThe 15.6-inch Full HD IPS display, enhanced with Acer BluelightShield and ComfyView technologies, offers vivid colors and sharp details while minimizing eye strain during long sessions. The raised bezel and Narrow Border Display design maximize screen real estate, providing an immersive experience.\nConnectivity is never an issue with the Acer Nitro V 15, featuring a range of ports including HDMI, USB-C 3.2 Gen 2/Thunderbolt 4/DisplayPort, and USB 3.2 Gen 1, catering to all your peripheral needs. The notebook\'s robust design, combining ABS plastic and polycarbonate materials, is both sleek and durable, ready to withstand the rigors of daily use while keeping your device secure with a Kensington security slot. Dual microphones and stereo speakers round out the package, offering a superior audio experience for gaming, movies, and video conferencing.','NVIDIA GeForce RTX 4050',99,NULL,'ASUS','COMPACT'),(10,'Laptop Dell Latitude 3420',1230,'1711081278418-dell-02.png','Up to 11th Gen Intel® TGL-U Celeron Core™ i7 processors offer businesses the performance, manageability, built-in security features and stability of Intel® and align to a future-proof roadmap. Download and smoothly run graphic-intensive applications with optional NVIDIA MX450.\n','Intel Iris Xe Graphics',99,NULL,'DELL','COMPACT'),(11,'test',1200,'6a7f4eb3-d772-4d37-80ec-79dad793cf7b.png','new product','test',0,NULL,'ASUS','Compact');
